import React, { useState } from 'react'
import { Form, Button, Container } from 'react-bootstrap'
import axios from 'axios';
import { useNavigate } from 'react-router-dom';

const BookSave = () => {

    const navigator = useNavigate();

    const [title, setTitle] = useState('');
    const [author, setAuthor] = useState('');
    const [publisher, setPublisher] = useState('');
    const [price, setPrice] = useState(0);
    const [createdAt, setCreatedAt] = useState('');
    const [thumbnailPhoto, setThumbnailPhoto] = useState('');
    const [detailPhoto, setDetailPhoto] = useState('');


    const setInputTitle = (e) => {
        setTitle(e.target.value);
    }

    const setInputAuthor = (e) => {
        setAuthor(e.target.value);
    }

    const setInputPublisher = (e) => {
        setPublisher(e.target.value);
    }

    const setInputPrice = (e) => {
        setPrice(e.target.value);
    }

    const setInputCreatedAt = (e) => {
        setCreatedAt(e.target.value);
    }

    const setInputThumbnailPhoto = (e) => {
        setThumbnailPhoto(e.target.value);
    }

    const setInputDetailPhoto = (e) => {
        setDetailPhoto(e.target.value);
    }


    const onClickSave = () => {
        const formData = new FormData();
        formData.append('title', title);
        formData.append('author', author);
        formData.append('publisher', publisher);
        formData.append('price', price);
        formData.append('created_at', createdAt);
        formData.append('thumbnailPhoto', thumbnailPhoto);
        formData.append('detailPhoto', detailPhoto);

        axios.post('http://localhost:8080/api_/bookSave', formData, ).then(res => {
            console.log(res.data);
            if (res.data > 0) {
                console.log('책 등록 성공');
                // 페이지 이동
                navigator('/bookList');
            } else {
                console.log('책 등록 실패');
            }
        }).catch(err => {
            console.log(err);
        });
    }

    return (
        <div>
            <Container style={{ width: '60%' }}>
                <Form.Group className="mb-2" controlId="username">
                    <Form.Label>책 제목</Form.Label>
                    <Form.Control
                        type="text"
                        placeholder="책 제목을 입력하세요."
                        onChange={setInputTitle}
                        required
                    />
                </Form.Group>
                <Form.Group className="mb-2" controlId="password">
                    <Form.Label>저자</Form.Label>
                    <Form.Control
                        type="text"
                        placeholder="저자를 입력하세요."
                        onChange={setInputAuthor}
                        required
                    />
                </Form.Group>
                <Form.Group className="mb-2" controlId="username">
                    <Form.Label>출판사</Form.Label>
                    <Form.Control
                        type="text"
                        placeholder="출판사를 입력하세요."
                        onChange={setInputPublisher}
                        required
                    />
                </Form.Group>
                <Form.Group className="mb-2" controlId="username">
                    <Form.Label>가격</Form.Label>
                    <Form.Control
                        type="number"
                        placeholder="가격을 입력하세요."
                        onChange={setInputPrice}
                        required
                    />
                </Form.Group>
                <Form.Group className="mb-2" controlId="username">
                    <Form.Label>출간일</Form.Label>
                    <Form.Control
                        type="text"
                        placeholder="출간일을 입력하세요."
                        onChange={setInputCreatedAt}
                        required
                    />
                </Form.Group>
                <Form.Group className="mb-2" controlId="username">
                    <Form.Label>썸네일 이미지</Form.Label>
                    <Form.Control
                        type="file"
                        placeholder="썸네일 이미지"
                        onChange={setInputThumbnailPhoto}
                        required
                    />
                </Form.Group>
                <Form.Group className="mb-2" controlId="username">
                    <Form.Label>상세 이미지</Form.Label>
                    <Form.Control
                        type="file"
                        placeholder="상세 이미지"
                        onChange={setInputDetailPhoto}
                        required
                    />
                </Form.Group>

                <div className="mb-4"></div>

                <Button className="w-100" variant="primary" onClick={onClickSave}>
                    책 등록
                </Button>
            </Container>
        </div>
    );
}

export default BookSave;
